    const [type,setType] = useState('text'); 
    const setText = () =>{
        setType('text');
    }
    const setPic = () =>{
        setType('pic');
    }
    const setVid = () =>{
        setType('vid');
    }
    return(
        <div className="box">
            <div className='tool'>
                <div className='tabs'>
                    <button onClick={setText}>Text</button>
                    <button onClick={setPic}>Picture</button>
                    <button onClick={setVid}>Video</button>
                </div>

            </div>
        </div>
    )
}

export default Content;
